import ReactDom from "react-dom";
import './index.css'

const firstBook = {
  title : "I love you to the moon and back",
  author : "pratyay gaurav",
  img :
   "https://m.media-amazon.com/images/I/51p2SDOCV9L._SX482_BO1,204,203,200_.jpg"
}

const secondBook = {
  title: "Rich Dad",
  author: "qwerty",
  img: "https://m.media-amazon.com/images/I/51p2SDOCV9L._SX482_BO1,204,203,200_.jpg",
};

const thirdBook = {
  title: "mythology",
  author: "Krishna",
  img: "https://m.media-amazon.com/images/I/51p2SDOCV9L._SX482_BO1,204,203,200_.jpg",
};

function BookList() {
  return (
    <section className="booklist">
      <Book
        img={firstBook.img}
        title={firstBook.title}
        author={firstBook.author}

      />
      <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Error, hic et. Quam similique cupiditate quae nisi rerum quas! Quae, vel.</p>

      <Book
        img={secondBook.img}
        title={secondBook.title}
        author={secondBook.author}
      />
      <Book
        img={thirdBook.img}
        title={thirdBook.title}
        author={thirdBook.author}
      />
    </section>
  );
}

  const Book = ({img,title,author,children}) => {
  // const {img,title,author} = props 
  return (
  <article className="book">
  <img src={img} alt=''/>
  <h1>{title}</h1>
  <h4>{author}</h4>
  </article>
  );
};




ReactDom.render(<BookList />, document.getElementById("root"));
